MGCAddSnippet(4, "This section introduces Calibre Cluster Manager (CalCM) and provides information on common CalCM terminology as well as product requirements.");
MGCAddSnippet(5, "Calibre Cluster Manager (CalCM) is a centralized service that collects pertinent information about currently running Calibre jobs, as well as the cluster and network on which these jobs are run. ");
MGCAddSnippet(6, "The benefits of CalCM include a series of applications that use the collected data to perform resource management and monitoring of Calibre jobs.");
MGCAddSnippet(7, "This section identifies the different roles and responsibilities associated with administering and using CalCM.");
MGCAddSnippet(8, "The CalCM flow includes several tasks associated with each job, such as monitoring, analyzing, communicating, updating, and dispatching. The network monitoring functionality in CalCM communicates with Calibre jobs running on the cluster and updates the status of the Calibre jobs at regular intervals. ");
MGCAddSnippet(9, "This section includes definitions for some key terms that are used when discussing CalCM. ");
MGCAddSnippet(10, "This section provides information on the requirements for running CalCM.");
MGCAddSnippet(11, "All remote hosts must be able to communicate with all primary hosts and the machine hosting the CalCM daemon must be able to communicate with all primary and remote hosts.");
MGCAddSnippet(12, "You must run the 2011.4 or newer version of the CalCM daemon to access the TAT application related features.");
MGCAddSnippet(13, "The Calibre Cluster Manager license is required to run CalCM and the Calibre Cluster Manager Plus licenses are required to use the advanced features of CalCM+. ");
MGCAddSnippet(14, "CalCM works in conjunction with the Calibre License Broker Daemon (LBD) to handle the licensing of Calibre jobs that run under CalCM. ");
MGCAddSnippet(15, "A CalCM configuration file and cluster configuration file are required in order to run the CalCM daemon. ");
MGCAddSnippet(16, "This section describes the environment variables that you use to configure the CalCM environment.");
MGCAddSnippet(17, "You execute the CalCM daemon from the command line. ");
MGCAddSnippet(18, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(19, "This section discusses several core concepts related to running CalCM.");
MGCAddSnippet(20, "The CalCM daemon runs as a background process collecting information about the jobs submitted under CalCM, as well as the cluster and network. ");
MGCAddSnippet(21, "You use configuration files to configure CalCM for your environment. Some configuration files are used to define aspects of CalCM at a global level, while other configuration files are used to define aspects at a job (or local) level. ");
MGCAddSnippet(22, "This section describes the key Tcl applications that control different aspects of CalCM. These applications are encrypted in the Siemens EDA software tree, but several code excerpts are included as examples in this manual. ");
MGCAddSnippet(23, "CalCM utilizes the Calibre License Broker Daemon (LBD) to manage licenses during a Calibre run. The CalCM daemon startup process automatically starts the License Broker Daemon.");
MGCAddSnippet(24, "The core of CalCM is the Network Monitor functionality, also referred to as Nemo, whose primary role is to collect information about Calibre jobs. All interactions with the OS and hardware for the purpose of data collection and system monitoring are actually performed by the Calibre primary and remote processes. The information about the cluster state is made available to Tcl applications hosted via the Network Monitor API (Nemo API).");
MGCAddSnippet(25, "This section describes some of the basic CalCM resource management tasks.");
MGCAddSnippet(26, "The Resource Monitoring application (calcm_rmonitor_app.tcl) collects resource, license, and job information. Using a CalCM web application, you can view this collected information in the form of custom usage plots and data tables.");
MGCAddSnippet(27, "The CalCM TAT application extends the CalCM capabilities by providing improved predictability for runtime modeling jobs.");
MGCAddSnippet(28, "This section includes several procedures that explain how to deploy and run CalCM and monitor resources and job information using the CalCM dashboard web application.");
MGCAddSnippet(29, "The following procedure provides the setting for deploying CalCM. ");
MGCAddSnippet(30, "This procedure describes how to start the CalCM daemon and view job information in a browser. ");
MGCAddSnippet(31, "The following procedure describes how to create job configuration files for Calibre jobs you want to run under CalCM.");
MGCAddSnippet(32, "The CalCM dashboard web application is used for monitoring a running CalCM process, visualizing graphical data, and providing user management and job control.");
MGCAddSnippet(33, "The system requirements and prerequisites for running the CalCM dashboard web application are provided.");
MGCAddSnippet(34, "This procedure describes the various job web pages and shows you how to submit Calibre jobs to run under CalCM with the CalCM dashboard web application.");
MGCAddSnippet(35, "This procedure describes how to use the Notifications web page in the CalCM dashboard application to view notifications and information for your running jobs. ");
MGCAddSnippet(36, "This procedure describes how to use the CalCM dashboard Nodes web pages to view primary and remote resource information collected by the Resource Manager application. Using this information, you can review how resources are allocated for CalCM jobs and make adjustments to the resources, as needed. ");
MGCAddSnippet(37, "This procedure describes how to use the Resource Monitor web pages in the CalCM dashboard application to view resource, license, and job utilization information collected by the resource monitoring application.");
MGCAddSnippet(38, "This procedure describes how to use the Resource Usage web pages in the CalCM dashboard application to view the CPU allocation by job and quota for a specified report period. You can also use the Resource Usage web pages to view the license usage by feature and group.");
MGCAddSnippet(39, "This procedure shows how to access the system utilization and application information in the CalCM dashboard web application.");
MGCAddSnippet(40, "This procedure describes how you can use chart menu functions to customize the displayed job data in the CalCM dashboard web application.");
MGCAddSnippet(41, "This procedure shows you how to control the number of active job records to display and how to easily compare chart information for multiple jobs in order to analyze runtime and scalability.");
MGCAddSnippet(42, "This procedure describes how to perform a live update of the page and chart information for active jobs in the Compare Jobs page in the CalCM dashboard web application.");
MGCAddSnippet(43, "This procedure describes how you can access and update the Settings pages in the CalCM dashboard web application.");
MGCAddSnippet(44, "With the Calibre Cluster Manager Plus (CalCM+) advanced features licenses, you can perform statistical analysis of job data and cluster utilization in the CalCM dashboard.");
MGCAddSnippet(45, "As part of the Calibre Cluster Manager Plus (CalCM+) advanced features, you can perform data analysis on your jobs by displaying the statistical data in an aggregated plot and tabular format for a specified period.");
MGCAddSnippet(46, "As part of the Calibre Cluster Manager Plus (CalCM+) advanced features, you can perform data analysis on your cluster utilization by displaying the statistical data in an aggregated plot and chart format for a specified period.");
MGCAddSnippet(47, "As part of the Calibre Cluster Manager Plus (CalCM+) advanced features, you can access the Calibre System Monitoring Solution (CalScope) software tool to view job and hardware monitoring data for your Calibre run.");
MGCAddSnippet(48, "Running CalCM with a backup daemon is necessary to ensure the continuous operation of CalCM in the event the primary daemon fails or is terminated. After launching the primary daemon, you can launch the backup daemon using the same CalCM configuration. The backup daemon then waits until the primary daemon fails or is terminated.");
