MGCAddSnippet(164, "This section contains example configuration files for CalCM and an example of the transcript output from the tool.");
MGCAddSnippet(165, "The CalCM configuration file is an ASCII file consisting of a series of statements that define options for the CalCM daemon. These options are applied to any Calibre job that is run using the associated instance of the CalCM daemon. ");
MGCAddSnippet(166, "The job configuration file defines job-specific attributes, such as the job priority, the rule file for the job, and the budget for job operations. The job configuration file is also used to define job account information. ");
MGCAddSnippet(167, "The CalCM daemon generates a transcript which is captured in a log file located at $CALCM_HOME/calcmd.log. ");
MGCAddSnippet(168, "This section provides a best practice for migrating, or porting, the CalCM daemon from one Calibre version to another.");
MGCAddSnippet(169, "When running CalCM in a production environment, system maintenance and upgrade events are commonplace. In some instances (for example, when you want to acquire newer capabilities of CalCM associated with a different version of Calibre), the CalCM daemon must be shut down and restarted. Keep in mind that in a production environment, this process must be a completely transparent operation. In other words, any system restart should have zero negative impact on any of the active or queued Calibre jobs, nor should it impede any production CalCM functionality - data, current or historical, should not be lost. The act of porting the CalCM daemon from one Calibre version to another is referred to as the migration process.");
MGCAddSnippet(170, "Typical users of CalCM fall into one of three primary categories: Information Technology Users, Production Flow Administrators, or Production Flow Users.");
MGCAddSnippet(171, "When the Calibre Cluster Manager (CalCM) daemon is running in a production environment, it typically has one or more Calibre jobs that it is constantly in communication with. At the same time, the jobs are also in constant communication with the License Broker Daemon (LBD) in order to properly serve up and retract licenses from jobs with positive or negative demand. On top of these two items, CalCM is also constantly collecting data and storing it within the application-specific databases in conjunction with keeping a transcription of all of the CalCM daemon-visible activities.");
MGCAddSnippet(172, "The section includes the tasks that are required to successfully migrate the CalCM Daemon to a new release of Calibre. These tasks should be performed in the order listed.");
MGCAddSnippet(173, "There exists a handful of actions that you must perform prior to migrating the CalCM daemon to a different Calibre version.");
MGCAddSnippet(174, "This procedure makes sure that CalCM is behaving as expected when running within the non-production environment using the new CalCM version.");
MGCAddSnippet(175, "Once CalCM has been qualified with the new version of Calibre, you can now perform the actual process of migrating CalCM.");
MGCAddSnippet(176, "Information on troubleshooting problems with CalCM is provided.");
MGCAddSnippet(177, "Setting up a test environment helps you to determine if there is a difference between the production and test environment. In addition, this setup can be used for other testing purposes.");
MGCAddSnippet(178, "This section provides information on using Tcl to develop custom CalCM applications.");
MGCAddSnippet(179, "This section provides fundamental information for using the Tcl programming language.");
MGCAddSnippet(180, "This section describes the process of developing an application for CalCM by analyzing a sample  Activity Log  Tcl application (calcm_actlog_app.tcl). This application is provided in an encrypted format in the software tree. The Activity Log application dumps snapshots of a cluster state into a log file, which can then be used to analyze cluster activity over a period of time.");
MGCAddSnippet(181, "In this procedure, you create a CalCM Activity Log application. ");
MGCAddSnippet(182, "This procedure describes how to set up a Tcl notification application for long‑running jobs using job meta‑data from the JOB INFO keyword in the job.conf file.");
MGCAddSnippet(183, "This section provides reference information on the Tcl commands that can be used to create or customize CalCM applications. Information is also provided on the cluster snapshot and related object types.");
MGCAddSnippet(184, "The cluster state is represented in the form of  snapshots.  A snapshot is a collection of consistent information about the cluster state at a specific moment in time. ");
MGCAddSnippet(185, "A cluster snapshot contains objects of different types that form the hierarchy. The most general type is the  Object  type, while  Job,   Process,  and  Node  are three different object types. The  Calibre  type is a specific  Process  type, which has the two types  Calibre Master  (primary process) and  Calibre Remote  (remote process).");
