MGCAddSnippet(212, "CalCM supports various platform tools by providing methods to integrate with different platform and system configurations.");
MGCAddSnippet(213, "You can specify the remote shell settings that CalCM uses to run Calibre jobs and Calibre remotes.");
MGCAddSnippet(214, "CalCM is configured by default to run Calibre remotes using the SSH utility. This avoids the connections limits imposed by the remote shell (RSH) utility.");
MGCAddSnippet(215, "You can optionally specify for CalCM to use the RSH remote shell utility instead of the default SSH remote shell utility. ");
MGCAddSnippet(216, "You can configure an SSH remote shell authentication key that enables CalCM to connect to other hosts without a manually entered password. ");
MGCAddSnippet(217, "CalCM supports IBM Platform LSF (LSF) and Univa Grid Engine (Grid) platform tools for controlling Calibre jobs and remotes. One method is to control the Calibre jobs with the platform tool and the remotes with remote shell. The other method is to control both the Calibre jobs and the remotes with the platform tool. ");
MGCAddSnippet(218, "CalCM supports the LSF platform tool to control Calibre jobs only. Remotes are launched with remote shell.");
MGCAddSnippet(219, "CalCM supports the LSF platform tool to control both Calibre jobs and remotes. ");
MGCAddSnippet(220, "CalCM supports the Grid platform tool to control Calibre jobs only. Remotes are launched with remote shell.");
MGCAddSnippet(221, "CalCM supports the Grid platform tool to control both Calibre jobs and remotes.");
MGCAddSnippet(222, "CalCM administrators can configure CalCM to use MySQL database management systems.");
MGCAddSnippet(223, "You can use the features provided by the convert_database shell command for upgrading the CalCM database for migration.");
MGCAddSnippet(224, "You can convert an existing database to the schema defined for the CalCM application using a Tcl script that can be implemented as a shell command.");
MGCAddSnippet(225, "The convert_database shell command converts an existing database to the schema defined for the CalCM application.");
MGCAddSnippet(226, "The convert_database shell command converts the source database using the schema defined in the CalCM applications for the target database schema. If the ‑schema argument option is used, you can define the target database schema according to the specified schema file.");
MGCAddSnippet(227, "The Calibre System Monitoring Solution (CalScope) software tool is included with the CalCM+ advanced features.");
MGCAddSnippet(228, "This section introduces the Calibre System Monitoring Solution (CalScope) software tool. It provides an overview of the product, followed by the flow, key concepts, requirements, syntax conventions, and mode of operation.");
MGCAddSnippet(229, "The CalScope software tool provides a system‑level solution for monitoring job and hardware information for data collection and Calibre run analysis.");
MGCAddSnippet(230, "The main components of the CalScope flow work together to collect data and then outputs job and hardware‑monitoring information.");
MGCAddSnippet(231, "Definitions are provided for key terms and concepts used for CalScope functionality.");
MGCAddSnippet(232, "The environment for running CalScope has certain hardware and software configuration requirements.");
MGCAddSnippet(233, "The primary mode of operation for CalScope is through the command‑line interface (CLI) and the CalScope dashboard web application.");
MGCAddSnippet(234, "This section covers how to configure the environment, invoke, and use the functionality of CalScope.");
MGCAddSnippet(235, "To set up database access for running CalScope, you must configure your environment as described.");
MGCAddSnippet(236, "The environment for running CalScope requires certain setup and configuration file specifications.");
MGCAddSnippet(237, "You configure the environment for running CalScope using specific database and file configurations.");
MGCAddSnippet(238, "The CalScope configuration file ranges in complexity from a simple configuration to a full configuration that includes multiple database applications. You specify this file using YAML format and copy it to your configuration file directory (conf/calscope.yaml).");
MGCAddSnippet(239, "You invoke and interact with CalScope from the CLI.");
MGCAddSnippet(240, "You interact with the monitored hosts through the CalScope CLI.");
MGCAddSnippet(241, "You can import a job transcript from a completed Calibre hardware‑monitored run and use CalScope to view the job and host information for detailed run analysis.");
MGCAddSnippet(242, "You can use the dashboard web application for CalScope to visualize graphical data for job operations and hardware and system metrics.");
MGCAddSnippet(243, "You can use the CalScope dashboard to compare job run time and scalability along with underlying hardware load/performance. This is especially useful to analyze slow runs and to compare benchmarks.");
MGCAddSnippet(244, "Specific command line arguments and options are used when invoking and interacting with the CalScope tool.");
MGCAddSnippet(245, "You specify the calscope command to invoke and interact with the CalScope tool. ");
MGCAddSnippet(246, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

